"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[61838],{28453:(e,i,n)=>{n.d(i,{R:()=>r,x:()=>o});var a=n(96540);const t={},s=a.createContext(t);function r(e){const i=a.useContext(s);return a.useMemo((function(){return"function"==typeof e?e(i):{...i,...e}}),[i,e])}function o(e){let i;return i=e.disableParentContext?"function"==typeof e.components?e.components(t):e.components||t:r(e.components),a.createElement(s.Provider,{value:i},e.children)}},97600:(e,i,n)=>{n.r(i),n.d(i,{assets:()=>l,contentTitle:()=>o,default:()=>h,frontMatter:()=>r,metadata:()=>a,toc:()=>c});const a=JSON.parse('{"id":"Foreign Policy/By Country 4/Oceania/Australia","title":"1. Australia","description":"Australia: Strategic U.S. Foreign Policy Analysis","source":"@site/docs/5. Foreign Policy/By Country 4/19. Oceania/1. Australia.md","sourceDirName":"5. Foreign Policy/By Country 4/19. Oceania","slug":"/Foreign Policy/By Country 4/Oceania/Australia","permalink":"/firstpub-Platform/docs/Foreign Policy/By Country 4/Oceania/Australia","draft":false,"unlisted":false,"editUrl":"https://github.com/unitedprogressparty/firstpub-Platform/tree/main/docs/5. Foreign Policy/By Country 4/19. Oceania/1. Australia.md","tags":[],"version":"current","sidebarPosition":1,"frontMatter":{"title":"1. Australia"},"sidebar":"tutorialSidebar","previous":{"title":"14. Venezuela","permalink":"/firstpub-Platform/docs/Foreign Policy/By Country 4/South America/Venezuela"},"next":{"title":"2. New Zealand","permalink":"/firstpub-Platform/docs/Foreign Policy/By Country 4/Oceania/New Zealand"}}');var t=n(74848),s=n(28453);const r={title:"1. Australia"},o=void 0,l={},c=[{value:"<strong>Preface</strong>",id:"preface",level:3},{value:"<strong>Crises</strong>:",id:"crises",level:3},{value:"<strong>2. Strategic Importance</strong>",id:"2-strategic-importance",level:3},{value:"<strong>3. Current Challenges and Opportunities</strong>",id:"3-current-challenges-and-opportunities",level:3},{value:"<strong>4. Policy Goals</strong>",id:"4-policy-goals",level:3}];function d(e){const i={br:"br",h3:"h3",hr:"hr",p:"p",strong:"strong",...(0,s.R)(),...e.components};return(0,t.jsxs)(t.Fragment,{children:[(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"Australia: Strategic U.S. Foreign Policy Analysis"})}),"\n",(0,t.jsx)(i.hr,{}),"\n",(0,t.jsx)(i.h3,{id:"preface",children:(0,t.jsx)(i.strong,{children:"Preface"})}),"\n",(0,t.jsx)(i.p,{children:"Current Relationship Description, including recent events"}),"\n",(0,t.jsx)(i.p,{children:"The United States and Australia share a robust and dynamic relationship, characterized by deep political, economic, and military ties. In recent years, this partnership has been further solidified through initiatives such as the AUKUS security pact, which aims to enhance defense collaboration, particularly in the Indo-Pacific region. Recent events have highlighted Australia's strategic importance, particularly in countering China's growing influence in the Pacific. The two nations have cooperated on various global issues, including climate change, trade, and regional security, reflecting a shared commitment to democratic values and stability."}),"\n",(0,t.jsxs)(i.h3,{id:"crises",children:[(0,t.jsx)(i.strong,{children:"Crises"}),":"]}),"\n",(0,t.jsx)(i.p,{children:"Australia is currently facing several crises, both domestically and regionally. One pressing issue is the impact of climate change, which has led to increased frequency and intensity of natural disasters, such as bushfires and floods. These environmental challenges not only threaten Australia's ecosystems but also strain its economy and public health systems. Additionally, the COVID-19 pandemic has exacerbated existing inequalities and stressed public health resources, necessitating ongoing recovery efforts."}),"\n",(0,t.jsx)(i.p,{children:"Regionally, Australia contends with the rising assertiveness of China, particularly in the South China Sea and the Pacific Islands. This geopolitical tension poses risks to regional stability and challenges Australia's security posture. The growing influence of China in the Pacific has led to concerns about economic dependency and political alignment among Pacific Island nations, prompting Australia to enhance its diplomatic and economic engagement in the region."}),"\n",(0,t.jsx)(i.p,{children:"Moreover, Australia is vigilant regarding the potential for domestic extremism and unrest, particularly in response to social and economic disparities heightened by the pandemic. The rise of far-right movements and anti-lockdown protests has raised concerns about social cohesion and public safety. As Australia navigates these internal and external crises, its partnership with the United States will be crucial in addressing shared challenges and promoting stability in the region."}),"\n",(0,t.jsx)(i.p,{children:"Looking ahead, the potential for increased tensions with China remains a critical concern. As Australia seeks to strengthen its alliances and enhance its defense capabilities, the risks of military confrontation or regional conflicts could escalate. The U.S. and Australia must work collaboratively to mitigate these risks and ensure a stable and secure Indo-Pacific region."}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"Frank Narrative"})}),"\n",(0,t.jsx)(i.p,{children:"Australia has been a steadfast ally of the United States, contributing significantly to U.S. strategic interests in the Indo-Pacific region. Historically, Australia has supported U.S. counterterrorism efforts and has been a key partner in military operations, including deployments in Afghanistan and Iraq. The Australian Defense Force is highly regarded for its capabilities and interoperability with U.S. forces, making Australia a critical partner in maintaining regional security. In the future, Australia can further assist the U.S. by providing enhanced intelligence-sharing capabilities and participating in joint military exercises that focus on countering potential threats from state and non-state actors in the region."}),"\n",(0,t.jsx)(i.p,{children:"In addition to security cooperation, Australia plays a vital role in U.S. energy security. As a major supplier of liquefied natural gas (LNG) to the U.S. and other countries, Australia can help diversify energy sources and reduce reliance on volatile regions. The U.S. seeks to strengthen its energy ties with Australia, encouraging investments in renewable energy projects that align with both nations' goals of transitioning to cleaner energy sources. Collaborating on energy innovation and technology transfer will not only bolster economic ties but also advance shared climate objectives."}),"\n",(0,t.jsx)(i.p,{children:"Australia expects support from the U.S. in addressing domestic challenges, particularly in the realm of economic diversification and technological assistance. As Australia transitions to a post-pandemic economy, there is a pressing need to bolster sectors such as technology and renewable energy. U.S. investments and expertise in these areas could stimulate job creation and economic resilience in Australia. Furthermore, as Australia grapples with climate change impacts, U.S. collaboration on environmental initiatives and disaster preparedness will be crucial in building adaptive capacity and promoting sustainable practices."}),"\n",(0,t.jsx)(i.p,{children:"Lastly, Australia anticipates ongoing support from the U.S. in navigating the complexities of regional diplomacy. The rise of China presents significant challenges, and Australia seeks U.S. leadership in fostering multilateral frameworks that promote stability and cooperation in the Indo-Pacific. By working together, the U.S. and Australia can address the evolving dynamics of the region and ensure that shared values of democracy and rule of law are upheld."}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"1. Overview"})}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"Country Profile:"})}),"\n",(0,t.jsx)(i.p,{children:"Australia is a vast country and continent located in the southern hemisphere, characterized by diverse geography that includes deserts, rainforests, and coastal regions. Its political system is a parliamentary democracy, with a constitutional monarchy, and it has a population of approximately 25.7 million people. Australia's economy is highly developed, with a GDP of approximately $1.4 trillion, and it ranks high in quality of life indices. The country has a relatively high freedom index score, reflecting its strong democratic institutions and protections for civil liberties."}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"Importance to National/Global Interests:"})}),"\n",(0,t.jsx)(i.p,{children:"Australia's strategic location in the Indo-Pacific region makes it a key player in global stability. Its abundant natural resources, including minerals and agricultural products, contribute to global supply chains and energy security. Furthermore, Australia's commitment to democratic values and human rights aligns closely with U.S. interests, enhancing its role as a partner in promoting regional security and stability."}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"Democracy Score:"})}),"\n",(0,t.jsx)(i.p,{children:"Australia scores highly on democracy indexes, reflecting a well-functioning political system that emphasizes the rule of law, free elections, and respect for individual rights. The ruling party, the Liberal-National Coalition, has faced challenges in addressing public concerns regarding climate change and social equity. While official structures support democratic governance, real-world political dynamics reveal tensions related to Indigenous rights and equitable representation, necessitating ongoing reforms."}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"Historical Context:"})}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Key Milestones in Bilateral Relations:"}),(0,t.jsx)(i.br,{}),"\n","The U.S.-Australia relationship has evolved significantly since World War II, with key milestones including the signing of the ANZUS Treaty in 1951, which established a mutual defense alliance. Subsequent military cooperation during the Vietnam War and joint operations in the Gulf War further solidified ties. Recent events, such as the establishment of the AUKUS pact in 2021, represent a new chapter in defense collaboration, particularly in response to regional security challenges."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Previous Agreements, Conflicts, or Partnerships:"}),(0,t.jsx)(i.br,{}),"\n","Historical partnerships have included joint military operations and intelligence-sharing agreements. While bilateral relations have generally been strong, they have faced challenges, such as differing approaches to climate change policy and trade disputes. Despite these tensions, ongoing cooperation in security, trade, and cultural exchanges remains a hallmark of U.S.-Australia relations."]}),"\n",(0,t.jsx)(i.hr,{}),"\n",(0,t.jsx)(i.h3,{id:"2-strategic-importance",children:(0,t.jsx)(i.strong,{children:"2. Strategic Importance"})}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"Economic Interests:"})}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Trade Relationships:"}),(0,t.jsx)(i.br,{}),"\n","Australia is one of the U.S.'s top trading partners, with significant exports of minerals, agricultural products, and services. The U.S. exports machinery, aircraft, and pharmaceuticals to Australia. Investments from both countries support job creation and economic growth, with U.S. companies heavily invested in sectors such as technology and finance."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Strategic Resources and Economic Partnerships:"}),(0,t.jsx)(i.br,{}),"\n","Australia's rich deposits of minerals and energy resources, particularly LNG, are critical to U.S. energy security. The partnership in renewable energy innovation also presents opportunities for diversification and economic resilience, aligning with both nations' climate goals."]}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"Security & Defense:"})}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Shared Security Concerns or Threats:"}),(0,t.jsx)(i.br,{}),"\n","Australia faces shared security concerns, including terrorism and regional tensions, particularly related to China's assertive actions in the South China Sea. The risk of domestic extremism and unrest remains, necessitating ongoing vigilance and cooperation between the U.S. and Australia."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Military Cooperation, Alliances, or Conflicts:"}),(0,t.jsx)(i.br,{}),"\n","The U.S. and Australia maintain strong military ties, including joint exercises and defense agreements. Future collaboration may focus on enhancing cybersecurity capabilities and addressing emerging threats in the Indo-Pacific region."]}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"Diplomatic Influence:"})}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Role in Regional/Global Diplomacy:"}),(0,t.jsx)(i.br,{}),"\n","Australia plays a pivotal role in regional diplomacy, promoting multilateral cooperation through platforms such as the Quad and ASEAN. Its engagement in international peacekeeping initiatives underscores its commitment to stability and security."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Potential for Multilateral Cooperation or Conflict Resolution:"}),(0,t.jsx)(i.br,{}),"\n","Australia's influence as a mediator in regional conflicts can facilitate dialogue and cooperation. The U.S. can leverage this influence to address shared challenges and promote conflict resolution initiatives."]}),"\n",(0,t.jsx)(i.hr,{}),"\n",(0,t.jsx)(i.h3,{id:"3-current-challenges-and-opportunities",children:(0,t.jsx)(i.strong,{children:"3. Current Challenges and Opportunities"})}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"Political & Governance Issues:"})}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Human Rights, Democracy, and Rule of Law Considerations:"}),(0,t.jsx)(i.br,{}),"\n","Australia has faced criticism regarding its treatment of Indigenous peoples and refugees. Addressing these human rights concerns is essential for maintaining strong bilateral relations and promoting democratic values."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Government Stability and Policy Continuity:"}),(0,t.jsx)(i.br,{}),"\n","Australia's government has navigated significant challenges, including public health crises and social unrest. Ensuring policy continuity and stability will be crucial for addressing ongoing issues and fostering a resilient economy."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"What agreements and treaties and organizations are we currently in together. List them all."}),(0,t.jsx)(i.br,{}),"\n","The U.S. and Australia participate in various agreements and organizations, including the ANZUS Treaty, the AUKUS pact, the Five Eyes intelligence alliance, and the Comprehensive and Progressive Agreement for Trans-Pacific Partnership (CPTPP)."]}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"Economic & Trade Concerns:"})}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Trade Imbalances, Sanctions, or Market Access Issues:"}),(0,t.jsx)(i.br,{}),"\n","While trade relations are generally robust, concerns about market access and tariffs persist. Both countries must work collaboratively to address any trade barriers and enhance economic cooperation."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Opportunities for New Trade Agreements or Partnerships:"}),(0,t.jsx)(i.br,{}),"\n","Emerging sectors, such as technology and renewable energy, present opportunities for new trade agreements and partnerships. U.S. investments in these areas could stimulate growth and innovation in Australia."]}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"Security and Geopolitical Tensions:"})}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Regional Conflicts or Alliances Affecting Bilateral Relations:"}),(0,t.jsx)(i.br,{}),"\n","Ongoing tensions in the South China Sea and the potential for conflict with China pose challenges for Australia and the U.S. Collaborative efforts to address these issues will be vital for maintaining regional stability."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Terrorism, Cybersecurity, and Military Escalation Risks:"}),(0,t.jsx)(i.br,{}),"\n","Emerging threats, including cyberattacks and domestic extremism, require joint efforts to enhance security and resilience. The U.S. and Australia must prioritize cooperation in cybersecurity and counterterrorism initiatives."]}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"Social & Cultural Dynamics:"})}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Migration, Cultural Exchange, and Public Opinion:"}),(0,t.jsx)(i.br,{}),"\n","Migration trends, particularly from the Pacific Islands, have implications for bilateral relations. Cultural exchange programs and public diplomacy initiatives can strengthen ties and promote mutual understanding."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Shared or Divergent Societal Values:"}),(0,t.jsx)(i.br,{}),"\n","While Australia and the U.S. share many cultural affinities, differences exist in areas such as climate policy and social justice. Addressing these divergences will be essential for fostering a harmonious relationship."]}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"Climate Change and Environmental Challenges:"})}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Impact of Climate Change on Both Nations:"}),(0,t.jsx)(i.br,{}),"\n","Climate change poses significant risks to both Australia and the U.S., threatening ecosystems, economies, and public health. Collaborative efforts to address these challenges will be crucial for sustaining bilateral relations."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Opportunities for Joint Climate Initiatives and Renewable Energy Projects:"}),(0,t.jsx)(i.br,{}),"\n","The U.S. and Australia can work together on renewable energy initiatives, promoting sustainable practices and technology transfer. Joint projects can bolster economic growth while addressing climate change."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Environmental Risks Affecting Bilateral Stability and Regional Security:"}),(0,t.jsx)(i.br,{}),"\n","Environmental degradation, exacerbated by climate change, can fuel conflict and instability. The U.S. and Australia must prioritize environmental cooperation to mitigate these risks and promote regional security."]}),"\n",(0,t.jsx)(i.hr,{}),"\n",(0,t.jsx)(i.h3,{id:"4-policy-goals",children:(0,t.jsx)(i.strong,{children:"4. Policy Goals"})}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"How Can This Country Help the U.S. Achieve Its Regional Goals?"})}),"\n",(0,t.jsx)(i.p,{children:"Australia can assist the U.S. in achieving its regional goals by continuing to play a leading role in security cooperation and counterterrorism efforts. The U.S. would like to see Australia enhance its defense capabilities and participate in joint exercises that focus on addressing potential threats from China and other regional actors. Moreover, Australia\xe2\u20ac\u2122s commitment to promoting democratic values and human rights aligns with U.S. interests in fostering stability in the Indo-Pacific."}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"What Does This Country Need from the U.S./World?"})}),"\n",(0,t.jsx)(i.p,{children:"Australia needs support from the U.S. in addressing domestic challenges such as economic diversification and climate change adaptation. U.S. investments in technology and renewable energy sectors could stimulate growth and resilience in Australia\xe2\u20ac\u2122s economy. Additionally, collaboration on public health initiatives and disaster preparedness will be essential for Australia\xe2\u20ac\u2122s recovery and capacity-building efforts."}),"\n",(0,t.jsxs)(i.p,{children:["Concrete Policy Proposal:",(0,t.jsx)(i.br,{}),"\n","The U.S. should propose a comprehensive partnership framework that focuses on enhancing defense cooperation, promoting economic ties, and addressing climate change collaboratively. This framework could include joint military training exercises, investments in renewable energy projects, and initiatives to support public health and disaster response capabilities."]}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"Diplomatic Objectives:"})}),"\n",(0,t.jsx)(i.p,{children:"The U.S. aims to strengthen alliances with Australia while managing adversarial relationships, particularly concerning China. Promoting democratic values and human rights will be central to diplomatic efforts, ensuring that both nations work together to uphold shared principles."}),"\n",(0,t.jsx)(i.p,{children:(0,t.jsx)(i.strong,{children:"Economic Strategies:"})}),"\n",(0,t.jsx)(i.p,{children:"The U.S. seeks to expand mutually beneficial trade and investment opportunities with Australia, particularly in sectors such as technology and renewable energy. Encouraging sustainable development practices will be crucial for fostering a resilient economic partnership."}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Public Health and Pandemic Preparedness:"}),(0,t.jsx)(i.br,{}),"\n","Australia's public health system has faced challenges during the COVID-19 pandemic, highlighting the need for ongoing collaboration in global health security. The U.S. can support Australia by providing technical assistance and resources for vaccine distribution and public health initiatives, ensuring a coordinated response to future health crises."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Migration, Refugees, and Border Management:"}),(0,t.jsx)(i.br,{}),"\n","Australia has experienced significant migration trends, particularly from the Pacific Islands, and has faced challenges related to refugee management. The U.S. can assist Australia in developing humane and effective border policies, while also supporting initiatives that address the root causes of migration, such as climate change and economic instability."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Corruption, Governance, and Institutional Transparency:"}),(0,t.jsx)(i.br,{}),"\n","Addressing corruption and promoting good governance are essential for strengthening bilateral relations. The U.S. should support initiatives that enhance transparency and accountability within Australian institutions, fostering a more robust partnership based on shared democratic values."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Regional Multilateral Engagement and International Institutions:"}),(0,t.jsx)(i.br,{}),"\n","Australia's active participation in regional organizations presents opportunities for multilateral cooperation. The U.S. can leverage Australia's influence within institutions such as the UN and ASEAN to address shared challenges and promote regional stability."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Human Rights and Social Justice Beyond Governance:"}),(0,t.jsx)(i.br,{}),"\n","The U.S. should advocate for the protection of human rights and social justice in Australia, particularly concerning Indigenous rights and labor rights. By emphasizing these issues in diplomatic engagements, the U.S. can help foster a more equitable and just society in Australia, thereby strengthening bilateral ties."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Tariff Report:"}),(0,t.jsx)(i.br,{}),"\n","Australia maintains a generally open trade policy, with low tariffs on most goods. However, some sectors, such as agriculture, face higher tariffs and trade barriers. Continued dialogue and negotiation can help address these issues and enhance trade relations."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Immigration to USA Report:"}),(0,t.jsx)(i.br,{}),"\n","Australia is one of the top countries of origin for immigrants to the United States. In recent years, the U.S. has implemented various visa programs to facilitate immigration from Australia, while also addressing concerns related to immigration reform and border security."]}),"\n",(0,t.jsxs)(i.p,{children:[(0,t.jsx)(i.strong,{children:"Visa Requirements for U.S. Citizens to Visit:"}),(0,t.jsx)(i.br,{}),"\n","U.S. citizens traveling to Australia for tourism or business purposes generally require a valid passport and an Electronic Travel Authority (ETA) or a Visitor Visa. The application process is straightforward, with approvals typically granted quickly."]}),"\n",(0,t.jsx)(i.hr,{})]})}function h(e={}){const{wrapper:i}={...(0,s.R)(),...e.components};return i?(0,t.jsx)(i,{...e,children:(0,t.jsx)(d,{...e})}):d(e)}}}]);